import React from 'react';
import Link from 'next/link';
import { Header } from '../components/Header/Header'

export default function Index() {
    return (
        <nav>
            <Link href="/posts">
                <a title="List of postse">List of posts</a>
            </Link>
            <Link href="/new">
                <a title="New post">New post</a>
            </Link>
        </nav>
    );
}
